VolledigeOmschrijving:
Het zonnetje in huis, daar ben je zonder meer van verzekerd in dit top appartement in de Weidevenne.

Aan de Melbournestraat vindt u dit plaatje. Het grote voordeel van dit appartement is de ruime hoeveelheid ramen, waardoor u verzekerd bent van voldoende lichtinval en een heerlijk zonnetje. Het uitzicht is fantastisch!

Wonen op deze locatie is als zitten op de eerste rang tijdens één van de beste concerten. Alles is namelijk op steenworp afstand: het winkelcentrum is nabij, zorgcentrum aan overzijde,  en binnen no-time rijdt u op de A7 of de Jaagweg. Voorzieningen voor openbaar vervoer op loopafstand: met de bus naar Amsterdam Centraal in 18 minuten en met de trein naar Schiphol in 27 minuten. Buiten dat alles woont u natuurlijk heerlijk rustig op deze hoogte: slechts één buurman op deze verdieping en een eigen dakterras dragen hier natuurlijk aan bij!

Indeling: 
Via het centrale trappenhuis bereikt u het appartement. De hal biedt toegang tot alle vertrekken. U kunt hierbij denken aan een ruimte voor de wasmachine/droger, apart hangend toilet, de badkamer met inloopdouche en wasgelegenheid en natuurlijk de slaapkamer. Deze ligt aan de achterzijde van het appartement en is voorzien van een mooie kastenwand.  

De woonkamer met open keuken is uitgestrekt over de gehele lengte van het appartement. De moderne keuken is voorzien van allerlei inbouwapparatuur en uitgevoerd in neutrale kleurstelling. Met dank aan de grote raampartijen aan alle kanten van de woning valt er meer dan voldoende licht in de woning wat een heerlijk woonklimaat tot gevolg heeft. De woonkamer beschikt over een grote schuifpui die u toegang biedt tot het grote (maar liefst 30 m2) dakterras, een uitermate goede plaats voor een barbecue en loungebank! 

Bijzonderheden: 
- Het pand beschikt over een gezamenlijke fietsenstalling; 
- Drukpomp ten behoeve van waterdruk in 2016 vervangen; 
- Service kosten zijn circa €98,- per maand; 
- Aanvaarding in overleg; 
- Notariskeuze is aan koper, deze dient in Waterland gevestigd te zijn.
